import * as React from 'react';
import { useLocation, Link } from 'react-router-dom';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import HomeIcon from '@mui/icons-material/Home';
import CampaignIcon from '@mui/icons-material/Campaign'; // Notices
import PlayCircleIcon from '@mui/icons-material/PlayCircle'; // Sermons
import GroupsIcon from '@mui/icons-material/Groups'; // Ministries
import EventIcon from '@mui/icons-material/Event';
import RoomIcon from '@mui/icons-material/Room'; // Location
import ConnectWithoutContactIcon from '@mui/icons-material/ConnectWithoutContact'; // Connect
import CopyrightIcon from '@mui/icons-material/Copyright';

const drawerWidth = 240;

const navItems = [
  { text: 'Home', icon: <HomeIcon />, path: '/' },
  { text: 'Notices', icon: <CampaignIcon />, path: '/announcements' },
  { text: 'Sermons', icon: <PlayCircleIcon />, path: '/sermons' },
  { text: 'Ministries', icon: <GroupsIcon />, path: '/ministries' },
  { text: 'Events', icon: <EventIcon />, path: '/events' },
  { text: 'Location', icon: <RoomIcon />, path: '/location' },
  { text: 'Connect', icon: <ConnectWithoutContactIcon />, path: '/connect' },
];

export default function NewSidebar({ expanded }) {
  const location = useLocation();
  const width = expanded ? drawerWidth : 64;

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <Drawer
        variant="permanent"
        sx={{
          width,
          flexShrink: 0,
          whiteSpace: 'nowrap',
          transition: 'width 0.3s',
          '& .MuiDrawer-paper': {
            width,
            boxSizing: 'border-box',
            transition: 'width 0.3s',
            overflowX: 'hidden',
            background: 'transparent',
            border: 'none',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'space-between',
            height: '100vh',
            minHeight: '100vh',
          },
        }}
        open
      >
        <Box>
          <List>
            {navItems.map((item) => {
              const isActive = location.pathname === item.path;
              return (
                <ListItem key={item.text} disablePadding sx={{ display: 'block' }}>
                  <ListItemButton
                    component={Link}
                    to={item.path}
                    sx={{
                      minHeight: 48,
                      justifyContent: expanded ? 'initial' : 'center',
                      px: 2.5,
                      borderRadius: 2,
                      my: 0.5,
                      color: isActive ? '#7F00FF' : '#555',
                      '&:hover': {
                        background: 'rgba(127,0,255,0.08)',
                        color: '#7F00FF',
                      },
                    }}
                  >
                    <ListItemIcon sx={{
                      minWidth: 0,
                      mr: expanded ? 2 : 'auto',
                      justifyContent: 'center',
                      color: isActive ? '#7F00FF' : '#555',
                    }}>
                      {item.icon}
                    </ListItemIcon>
                    {expanded && <ListItemText primary={item.text} sx={{
                      color: isActive ? '#7F00FF' : '#555',
                      fontWeight: isActive ? 600 : 400,
                      fontSize: 16,
                    }} />}
                  </ListItemButton>
                </ListItem>
              );
            })}
          </List>
        </Box>
        <Box sx={{ textAlign: 'center', pb: 2, pt: 1 }}>
          <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', color: '#aaa', fontSize: 13 }}>
            <CopyrightIcon sx={{ fontSize: 16, mr: 0.5 }} />
            2025
          </Box>
          <Box sx={{ color: '#aaa', fontSize: 10, letterSpacing: 1, mt: 0.5 }}>
            Globe Technologies
          </Box>
        </Box>
      </Drawer>
    </Box>
  );
}
